function changelogLine(e){var o=new Date(e.date.replace(/-/,"/")),t=["January","February","March","April","May","June","July","August","September","October","November","December"],n=t[o.getMonth()],r=o.getUTCDate(),i=o.getFullYear();$("<tr><td><a href='"+e.link+"'>"+e.version+"</a></td><td>"+e.description+"</td><td>"+n+"-"+r+"-"+i+"</td></tr>").appendTo("table")}$(document).ready(function(){$.getJSON("https://raw.githubusercontent.com/Christianjuth/calculator-browser-extension/JSON/changelog.json",function(e){for(i=0;i<e.length;i++)line=e[i],changelogLine(0==i?line:line)})});